import React from 'react';

const courses = [
    '11th Commerce',
    '12th Commerce',
    'B.Com',
    'M.Com',
    'BBA',
    'MBA',
    // Add more courses as needed
];

const Courses = () => (
    <div style={{ padding: '2rem' }}>
        <h1>Our Courses</h1>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '1.5rem' }}>
            {courses.map((course, idx) => (
                <div
                    key={idx}
                    style={{
                        minWidth: '200px',
                        padding: '1rem',
                        border: '1px solid #ccc',
                        borderRadius: '8px',
                        background: '#f9f9f9',
                        textAlign: 'center',
                        boxShadow: '0 2px 8px rgba(0,0,0,0.05)'
                    }}
                >
                    <h2 style={{ fontSize: '1.2rem', margin: 0 }}>{course}</h2>
                </div>
            ))}
        </div>
    </div>
);

export default Courses;
